Unable to update data values on mongoDb native findOneAndUpdate query<pre><code>exports.update_activity_status = (req, res) =&gt; {
  const {
    campaign_id,
    leadId,
    leadActivity,
    status,
  } = req.body;

  const client = mongoClient.connect(`${process.env.MONGO_URL}`, {
    useUnifiedTopology: true,
  });
  client.then((cli) =&gt; {
    cli
      .db(`${process.env.DATABASE_NAME}`)
      .collection(`${process.env.ACTIVITY_COLLECTION}`)
      .findOneAndUpdate(
        {
          "data.campaign_id": mongoose.Types.ObjectId(campaign_id),
          "data.leads.$._id": mongoose.Types.ObjectId(leadId),
          // "data.leads._id" : leadId
        },
        {
          $set: {
            "data.leads.$.leadActivity": leadActivity,
            "data.leads.$.status": status,
          },
        },
        {
          returnNewDocument: true,
        }
      )
      .then((result) =&gt; {
        console.log("UPDATED RESULT", result);
        res.json(result)
      })
      .catch((err) =&gt; console.log("new err", err));
  });
};
</code></pre>

<p>In my query, I need to update the status and leadActivity of the users whose <code>leadId</code> matches the following conditions:</p>

