<li>leadsId that matches inside that particular document (not working).</li>
</ol>

<p>First I tried using only <code>db.find({"data.campaign_id": mongoose.Types.ObjectId(campaign_id)})</code> and it returns me the data that matches only the first condition as specified above. As soon as I try it along with second condition and <code>findOneAndUpdate({....})</code>, accessing the nested data after including secondary filter condition returns <code>null</code>. </p>

<p>Here's is what my document object looks like:</p>

