How do I update a document property's sub-property?<p>I want to update an object or create it if it doesn't exist. But more specifically, I want to update a nested property with a dynamic property name.</p>

<pre><code>let $set = {
  $set: {
    dirs: {},
    path: subPath
  }
};
$set.$set.dirs[dir] = true;
promises.push(this.db.collection("dir").update(
  { path: subPath },
  $set,
  { upsert: true }
).catch(err =&gt; {
  console.log("err", err)
}));
</code></pre>

<p>The problem with this is that it doesn't just append the property, it overwrites the <code>dirs</code> property with a single child. The resulting document structure is like so:</p>

<pre><code>{
    "_id" : ObjectId("5ede79cb275bd377d80efac3"),
    "path" : "E:\\options-data\\AAPL\\2004",
    "dirs" : {
        "01" : true
    }
}
</code></pre>

<p>dirs will never have more than one property this way. If I have to actually load the document first to check the dirs and update them accordingly, that would be extremely slow considering I need to do this operation hundreds of millions of times.</p>

