How to query all instances of a nested field with variable paths in a MongoDb collection<p>I have a collection that has documents with a field called <code>overridden</code>. I need to find the number of times <code>overridden: true</code>.</p>

<p>So for example, I have a collection as follows:</p>

<pre><code>[ // assume this is my collection / array of documents

    { // this is a document
        textfield1: {
            overridden: true,
        },
        page1: {
            textfield2: {
                overridden: true,
            },
            textfield3: {
                overridden: false,
            }
        },
        page2: {
            section1: {
                textfield4: {
                    overridden: true,
                }
            }
        }
    },

    { // this is a different document
        page1: {
             section1: {
                 textfield1: {
                     overridden: false,
                 },
                 textfield2: {
                     overridden: false,
                 }
             },
             section2: {
                 textfield3: {
                     overridden: true,
                 }
             }
       }
    }
}
</code></pre>

<p>So from the above, I need to get <code># of fields overridden = 4</code>.</p>

<p>This is a simplified example of how the documents in the collection are structured. I'm attempting to show that:</p>

<ol>
<li>There is no guaranteed structure to find the path to each <code>overridden</code> field in the document.</li>
<li>I need to aggregate across documents in the collection.</li>
</ol>

<p>From research online, I did the following:</p>

<pre><code>db.reports.aggregate()
    .group({
        _id: "overridden",
        totalOverridden: { 
            "$sum": { 
                $cond: [ { "overridden": true }, 1, 0]
            }
        }
    })
</code></pre>

<p>That gave me a value of 2472 in the actual collection, which looks like the total number of times that field occurs because if I remove the entire <code>$cond</code> I still get the same value. From the looks of it, <code>{ "overridden": true }</code> always returns true, because if I flip the if-else return values (or just do <code>$sum: 1</code>), I get 0.</p>

<p>If it's any help, I do actually have mongoose schemas with defined paths for each <code>overridden</code> field but the schema is a bit large and heavily nested, therefore tracking each path would be quite tedious. That being said, if the above is not possible, I'm open to suggestions for analyzing the schema/document JSON as well to get the different paths and somehow using those to query all the fields.</p>

<p>Thanks a ton! I'd appreciate any help. :-)               </p>

